import React from "react";

function CreateProfessionalAccount() {
  return (
    <div style={{ textAlign: "center", padding: "20px" }}>
      <h1>Create Professional Account</h1>
      <form>
        <input type="text" placeholder="Full Name" style={{ display: "block", margin: "10px auto", padding: "10px" }} />
        <input type="text" placeholder="Address" style={{ display: "block", margin: "10px auto", padding: "10px" }} />
        <input type="email" placeholder="Email" style={{ display: "block", margin: "10px auto", padding: "10px" }} />
        <button style={{ padding: "10px 20px" }}>Sign Up</button>
      </form>
    </div>
  );
}

export default CreateProfessionalAccount;
